import React from 'react';
import ReactDOM from 'react-dom';

const Header = (props) => (
    <>
    <h1>{props.course}</h1>
    </>
)

const Content = (props) => (
    <>
    <p> {props.description} {props.value}</p>
    </>
)

const Total = (props) => (
    <>
    <p> Number of exercises = {props.values.reduce((a,b) => a + b, 0)}</p>
    </>
)

const App = () => {
    const course = "Half Stack app development"
    const parts = [
        { name: 'Fundamentals of React', exercises:10},
        { name: "Using props to pass data", exercises: 7},
        { name: "State of a component", exercises: 14}
    ]
    return (
        <div>
            <Header course={course}/>
            <Content description={parts[0].name} value={parts[0].exercises}/>
            <Content description={parts[1].name} value={parts[1].exercises}/>
            <Content description={parts[2].name} value={parts[2].exercises}/>
            <Total  values={[parts[0].exercises, parts[1].exercises, parts[2].exercises]}/>
        </div>
    )
}

ReactDOM.render(<App />, document.getElementById('root'));
